Defendant Ronnell Mj Cegers in court with attorney James T Moczydlowski.  Defendant Ronnell Mj Cegers in custody.  Benjamin Lindsay appeared for the State of Wisconsin.  Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

AS TO BOTH COUNTS:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

Sentencing proceeded.  Statements made by State, defense,  and defendant.  On state's oral motion, the Court amends language contained in the amended information as to Count 1 to reflect charge of obstructing an officer.
 
AS TO COUNT 1:  The Court sentenced the defendant to serve 9 MONTHS in the House of Correction, with Huber release for employment, Consecutive to any other sentence, with credit for 2 days served. 

The Court STAYED this sentence and placed the defendant on probation for a period of 1 YEAR with the following conditions.

CONDITIONS OF PROBATION:
*Obtain AODA assessment and successfully complete follow-up treatment;
*Participate with random urine screens;
*No illegal drugs or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Obtain/maintain full time employment;
*Pay all supervision fees;
*As to both counts:  Pay dna surcharge, all other mandatory surcharges, fees, assessments, and costs by the end of supervision period or any remaining balance shall convert to civil judgment.  

State in compliance with victim rights legislation.  The Court ordered restitution set at zero.

AS TO COUNT 2:  The defendant ordered to serve 90 DAYS in the House of Corrections with credit for 70 days time served.  The Court finds that this sentence is time served.  

Appeal rights given by the court.
